import { Grid,Paper, Box,Typography,styled } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'
import { useSelector, useDispatch } from 'react-redux'
import '../Details/UserList.css'
import { Actiontypes } from '../Reducer/action'
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import AddIcon from '@mui/icons-material/Add';
import Tooltip, { tooltipClasses } from '@mui/material/Tooltip';

const BootstrapTooltip = styled(({ className, ...props }) => (
  <Tooltip {...props} arrow classes={{ popper: className }} />
))(({ theme }) => ({
  [`& .${tooltipClasses.arrow}`]: {
    color: theme.palette.common.black,
  },
  [`& .${tooltipClasses.tooltip}`]: {
    backgroundColor: theme.palette.common.black,
  },
}));

export const UserList = () => {
  const contacts = useSelector((state) => state);
  const dispatch = useDispatch()

  const deleteAccount = (id) => {
    dispatch({ type: Actiontypes.DELETE_CONTACT, payload: id })
  }



  return (
    <div >
      <Typography sx={{mt:3,textAlign:'center',fontSize:'35px',fontFamily:'sans-serif'}}>
     Account Datas
      </Typography>
    <Box >

    <Grid container justifyContent={'center'}>
        <Grid item xs={12} sm={8} md={6.5} sx={{ marginTop: 3,boxShadow: 'rgba(149, 157, 165, 0.2) 0px 8px 24px'}}>
          <Paper
            sx={{ padding: '17px', height: 'fit-content', marginLeft: '7px' }}
          >

            <Link to="/">
              <Box
                style={{

                }}>

                 <AddIcon/> 
               <Typography> Add user </Typography>
              </Box>
            </Link>

            <div >
              <table style={{ marginTop: 5,width:'100%'}} >
                <thead>
                  <tr style={{ backgroundColor: '#CF4B28', color: 'white' }}>
                    <th>id</th>
                    <th>Account Name</th>
                    <th>Account Code</th>
                    <th>Account Type</th>
                    <th>Description</th>
                    <th>Actions</th>

                  </tr>
                </thead>
                <tbody >


                  {contacts.length > 0 ? (
                    contacts.map((contact, id) => (
                      <tr key={id}>
                        <td>{id + 1}</td>
                        <td>{contact.name}</td>
                        <td>{contact.code}</td>
                        <td>{contact.type}</td>
                        <td>{contact.description}</td>

                        <td>
                          <Link to={`/edit/${contact.id}`}>

                            <button
                              style={{

                               border:'none'
                              }}>
                            <Typography sx={{
                              color:'#CF4B28'
                            }}>
                             <BootstrapTooltip title="Edit" placement="top-start" arrow>
                               <EditIcon sx={{cursor:'pointer'}}/> 
                               </BootstrapTooltip>
                            </Typography>
                            </button>
                          </Link>

                          <button
                            type="button"
                            style={{border: 'none'}}
                            onClick={() => deleteAccount(contact.id)}>

                            <Typography sx={{
                              color:'#CF4B28'
                            }}>
                            <BootstrapTooltip title="Delete" placement="top-start" arrow>  
                            <DeleteIcon sx={{cursor:'pointer'}}/> 
                            </BootstrapTooltip>
                            </Typography>
                          </button>
                        </td>
                      </tr>
                    ))
                  ) : (
                    <tr>
                      <th>No contacts found</th>
                    </tr>
                  )}
                </tbody>

              </table>
            </div>

      </Paper>
    </Grid>
    </Grid>
    </Box>

    </div>
  )
}
